  \"Hybrid Aerogel-MLI Insulation System for Cryogenic Storage in Space Applications
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 6,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-07T03:33:51.543761\",\n\t\"name\":
  \"hybrid-aerogel-mli-insulation-system-for-cryogenic-storage-in-space-applications-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The future of the NASA space program includes
  longer and more invasive missions into space, with a goal to return to the moon's
  surface by the year 2015.  Long duration storage of large quantities of cryogenic
  fluids for propulsion, power, and life-support is an essential requirement for these
  missions.  The behavior of active and passive cryogenic management is paramount
  to the thermal status of a spaceship and cryotanks storage.  Efficient and reliable
  insulation materials are key to the success of long missions into space.  Aspen
  Aerogels proposes to develop a durable and cost effective hybrid aerogel/MLI insulation
  system for cryogenic storage in space applications.  The proposed hybrid insulation
  system will withstand micrometeoroids impacts and will outperform the MLI in cases
  of vacuum loss.  During the Phase II Program, extensive work will be dedicated to
  the developing a system level solution for installation of the flexible hybrid insulation
  system onto cryotank surfaces to minimize seams, and thermal leaks.  Development
  of the proposed novel cost effective insulation package will provide NASA with a
  long-term cryogenic propellant storage thermal control solution for applications
  in low earth orbit (LEO), and on the lunar surface. \",\n\t\"license_title\": \"U.S.
